$_MODULE['<{relaiscolis}prestashop>about_0295df9d2bbb57c9737ef405b7adc34b'] = 'La philosophie Relais Colis c’est de proposer des solutions efficientes, responsables et créatrice de valeur :';
$_MODULE['<{relaiscolis}prestashop>about_b54528098054df2d70b83d93c8a3009f'] = 'Promesses tenues';
