$_MODULE['<{relaiscolis}prestashop>about_88203f91badb7592745fd1251a93bc6b'] = 'Moins de km = moins de CO2 = meilleurs prix';
$_MODULE['<{relaiscolis}prestashop>about_7536fe19b46895a9adf55806bfd7b308'] = 'SAVOIR-FAIRE ET AMBITIONS';
$_MODULE['<{relaiscolis}prestashop>about_4fdb3c01e80cf97513c7dfbc7ab2aa9b'] = 'L’atout proximité : ';
$_MODULE['<{relaiscolis}prestashop>about_a6a703eb2f24211ed35f335e4c26e64f'] = 'Grâce à une couverture du terrain de plus en plus dense, la proximité est l’un des atouts majeurs de Relais Colis. Près de 92% de la population se trouve à moins de 10 minutes d’un point Relais et 100% à moins de 5 minutes dans les grandes villes. Les larges amplitudes horaires, la liberté de retirer son colis quand on le souhaite et la présence de nos relais sur les points de passages nous permet de construire une proximité de vie pour vos clients acheteurs.';
$_MODULE['<{relaiscolis}prestashop>about_cb32b38328f00de2dbc0bc046f3b5946'] = 'L’atout sérénité :';
$_MODULE['<{relaiscolis}prestashop>about_65a7ecc166de28077c0e089f8a8b752c'] = 'La diversité de ses partenaires (Téléphonie, grande distribution, artisans, consignes …) permet à chacun de bénéficier d’un accès aux colis simplifié sur de larges plages horaires. L’animation quotidienne des points en locale permet de vous apporter un accueil de qualité, et une gestion du capacitif pour offrir la meilleure expérience client, tout au long de l’année.';
$_MODULE['<{relaiscolis}prestashop>about_95b643b415bc88caea416dd92a1ca6c0'] = 'La traçabilité est au cœur de nos process avec des terminaux dernière génération à la fois dans nos relais et sur nos quais, un nouveau suivi en ligne très convivial et une équipe relation clients disponible et proactive.';
$_MODULE['<{relaiscolis}prestashop>about_ccc66b5085097766819549d96218ac23'] = 'La satisfaction clients :';
$_MODULE['<{relaiscolis}prestashop>about_6b54d2bec769e2fed5d33c6251e26aab'] = 'Aussi bien pour nos enseignes partenaires que pour nos clients finaux, Relais Colis place la satisfaction clients au cœur de son processus. Ainsi, les enseignes disposent d’un web-service, d’un chargé de clientèle dédié, d’un commercial et d’outils de traçabilité afin de travailler en parfaite synergie avec nos équipes. Nos partenaires et nos équipes sont pilotés par les indicateurs de satisfaction clients, au cœur de notre mission.';
$_MODULE['<{relaiscolis}prestashop>about_d3fc3a1eb969513221b386c76e56133d'] = 'Les ambitions :';
$_MODULE['<{relaiscolis}prestashop>about_80aaff21e00d36ffe3d25d7ba58e0ae8'] = 'Concevoir et développer avec les marques du e-commerce la meilleure expérience pour leurs clients, et contribuer ainsi à leur création de valeur.';
$_MODULE['<{relaiscolis}prestashop>about_76f8ad6085c0565c61f3c78ad63ce473'] = 'LES OFFRES';
$_MODULE['<{relaiscolis}prestashop>about_37c240f5962c6eba91edee397e0124fd'] = 'Relais Colis s’adapte à la réalité du marché du e-commerce en proposant des offres qui répondent à l’ensemble des besoins clients.';
$_MODULE['<{relaiscolis}prestashop>about_850f246355b064bdf92bdfa80c1a9ee6'] = 'Pour les e-commerçants envoyant jusqu’à 10 colis par jour / 2 500 colis par an : Relais Colis FIRST';
$_MODULE['<{relaiscolis}prestashop>about_383a0457549c7b22160fd1c4c5194f75'] = 'Un mode de livraison alternatif, la livraison de vos colis jusqu\'à 20 kg et 1,70 m de développé en relais colis.';
$_MODULE['<{relaiscolis}prestashop>about_d56c553e92dc03c0f976cece3bf876c4'] = 'Un prix très accessible de 3,49€ HT à 15,60€ HT pour vos colis de 20 kg, soit jusqu’à deux fois moins cher qu’un envoi postal.';
$_MODULE['<{relaiscolis}prestashop>about_d630011aed72609bb85cc12741b2e85c'] = 'Une solution sans engagement de volume ni de durée, une gestion simple depuis votre espace clients.';
$_MODULE['<{relaiscolis}prestashop>about_7207a5eb79a3eecf5af14f6137365fa4'] = 'Une installation facile en plug and play et entièrement gratuite.';
$_MODULE['<{relaiscolis}prestashop>about_528331a1844ff44aa5fb5b05633e203e'] = 'Comment ça marche : une fois le module installé, vous créditez votre compte créé sur relaiscolis.com, vos étiquettes s’éditent au fur et à mesure, vous n\'avez plus qu\'à déposer vos colis dans le relais de votre choix parmi nos 6 600 relais.';
